import { RECEIVE_SELECTED_ASSET } from "./asset.actions";
INITIAL_STATE = {    assetID: '',
  assetName: '',
  assetSerial: '',
  assetImage: '',
  assetStatus:'',}

// eslint-disable-next-line import/no-anonymous-default-export
const assetData = (state = {}, { type, assetData }) => {
  switch (type) {
    case RECEIVE_SELECTED_ASSET:
      return assetData;
    default:
      return state;
  }
};
export default assetData;
